function HeroImage(props: BoxProps) {
  const items = [
    <HeroItem1 key={1} />,
    <HeroItem2 key={1}/>,
    <HeroItem3 key={1}/>,
  ]
    return (
      <Box {...props}>
        <Swiper
          spaceBetween={50}
          slidesPerView={1}
          autoplay={{
            disableOnInteraction: false,
            delay: 1000,
          }}
          speed={1000}
          loop={true}
        >
          {items.map((item, i) => <SwiperSlide key={i}>{item}</SwiperSlide>)}
        </Swiper>
      </Box>
    )
}

export default HeroImage